import {useState} from 'react'

const SignUp = () => {

    const [sign,setSign] = useState({
        name:'',
        email:'',
        pass:''
    })
  return (
    
    <div className="main">
     
        <h1>Register</h1>
        <input  className="inbox" type="text" placeholder="Enter Name" value={sign.name} onChange={(e)=>setSign({...sign, })} />
        <input className="inbox"  type="email" placeholder="Enter Email" value={sign.email}/>
        <input className="inbox"  type="password" placeholder="password" value={sign.password}/>
        <button>SignUp</button>
      
    </div>
  )
}

export default SignUp
